Taboo: Filthy Jobs
The grimy, nasty filth nobody wants to be around is an everyday sight for these dirty job cleaners. In Minneapolis, a team of heavy-duty housecleaners tackles a truly filthy, foreclosed house. One of the most disgusting basements you'll ever see a laundry full of cat feces, an appalling fridge freezer and a backed-up toilet that would test even the strongest stomach.

